Маркетинг на аутсорсинге - передача части или всех маркетинговых функций внешнему исполнителю.       
Вы когда-нибудь думали о том, что можно передать свой маркетинг частично или даже полностью на аутсорсинг?  Если у Вас нет отдела маркетинга, то это позволило бы Вам передать часть своей работы профессионалу, а самому сконцентрироваться на стратегических задачах своего бизнеса. Если же он у Вас есть - то обеспечить своих сотрудников дополнительными рабочими руками.      
Какие преимущества это дает:    
 - Экономия фонда заработной платы. Вам не нужно нанимать сотрудника на целый день и нести связанные с этим расходы: заработная плата, социальные выплаты, обеспечение рабочего места и другое. ;     
 - Маркетолог на аутсорсинге не уйдет на больничный в самый ответственный момент, в отпуск или в декрет;  
 - Ненормированный рабочий день такого маркетолога. За помощью к нему можно обратиться в любое время (кроме ночного), в том числе в субботу и воскресенье;
